import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="portada">
        <h1 className="titulo">Snacks Kary</h1>
        <p className="descripcion">Contamos con excelente servicio y calidad en nuestros productos.</p>
        <nav className="navbar">
        <ul className="menu">
          <li><a href="#">Alimentos</a></li>
          <li><a href="#">Pedido</a></li>
          <li><a href="#">Forma de Pago</a></li>
        </ul>
        <div className="cart">
          <img src="cart-icon.png" alt="Cart Icon" />
          {/* Aquí puedes agregar un contador o alguna indicación del número de elementos en el carrito */}
        </div>
      </nav>
      </div>
      </header>
    </div>
  );
}

export default App;
